import dynamic from 'next/dynamic'
import 'react-sticky-video/dist/index.css';
const StickyVideo = dynamic( () => import('react-sticky-video'), {ssr: false}) 

const Video = ({}) => {

  return (
    <div className="video">
      <div className="video-title">What is SPM?</div>
      <div className="video-subheading">See the Video Below</div>
      <div className="video-player">
        <iframe class="responsive-iframe" src='media/video.mp4' border="0" cellspacing="0" frameborder="0" />
      </div>
    </div>
  )
}

export default Video
